import { backendAPI } from '@instinct-web/core';
export class PoliticalPartyServiceImplementation {
  async getAll() {
    const politicalParties = await backendAPI.get('political-parties');
    return politicalParties.data;
  }

  async getByID(politicalPartyID) {
    const politicalParty = await backendAPI.get(`political-parties/${politicalPartyID}`);
    return politicalParty.data;
  }

  async create(politicalPartyDTO) {
    const newPoliticalParty = await backendAPI.post('political-parties', politicalPartyDTO);
    return newPoliticalParty.data;
  }

  async updateByID(politicalPartyID, politicalPartyDTO) {
    await backendAPI.patch(`political-parties/${politicalPartyID}`, politicalPartyDTO);
  }

  async deleteByID(politicalPartyID) {
    await backendAPI.delete(`political-parties/${politicalPartyID}`);
  }

  async joinByID(politicalPartyID) {
    await backendAPI.post(`political-parties/${politicalPartyID}/membership`);
  }

  async leaveByID(politicalPartyID) {
    await backendAPI.delete(`political-parties/${politicalPartyID}/membership`);
  }

}
